	f0_local0( self, f1_local1, controller )
	if CONDITIONS.IsArabic() then
		ACTIONS.AnimateSequence( self, "AR" )
	end
	if CONDITIONS.IsJapanese() then
		ACTIONS.AnimateSequence( self, "JA" )
	end
	return self
end

